/* global describe it */
const process = require('process');
const expect = require('chai').expect;

const func = require('.');
const title = '76. 最小覆盖子串';
const tepmlate = ({ input, output }) =>
  `输入: S = "${input[0].length <= 64 ? input[0] : input[0].slice(0, 64) + '...'}",
            T = "${input[1].length <= 64 ? input[1] : input[1].slice(0, 64) + '...'}"
      输出: "${output.length <= 64 ? output : output.slice(0, 64) + '...'}`;

const samples = [
  {
    input: ['ADOBECODEBANC', 'ABC'],
    output: 'BANC',
  },
  {
    input: ['', ''],
    output: '',
  },
  {
    input: ['a', 'b'],
    output: '',
  },
  {
    input: ['aa', 'aa'],
    output: 'aa',
  },
  {
    input: ['JQNAZEGFYWKZEXFCEPSDGBPODLJNXFTZHNWFCHAOSMPFDIM', 'IND'],
    output: 'NWFCHAOSMPFDI',
  },
  JSON.parse('{"input":["",""],"output":""}'),
];

describe(title, function () {
  for (const i of samples) {
    process.send && process.send({ log: tepmlate(i) });
    it(tepmlate(i), function () {
      expect(func(...i.input)).to.equal(i.output);
    });
  }
});
